import React from 'react';
import './Welcome.css';

function Welcome() {
  return (
    <div
      className="ouverture"
      style={{
        background: `url(${process.env.PUBLIC_URL + '/ab.png'}) center/cover no-repeat`
      }}
    >
      <h1>Bienvenue !</h1>
      <a href="/accueil" className="btn">Entrer sur le site</a>
    </div>
  );
}

export default Welcome;
